import React, { Component } from 'react';

import Chart from 'chart.js';



const PlotScreen = () => {


    return (
        <div>
            <h1> PLOT SCREEN </h1>
            <canvas id="myChart" width="400" height="400"></canvas>
        </div>
        )
}

export default PlotScreen;
